import {FaTwitter,FaLinkedin,FaInstagramSquare,FaFacebookF } from 'react-icons/fa';

function Footer(){
	return(
	<>
	<div className="container">
	<div className="row">
	<div className="col-md-3 mx-5">
	<FaTwitter/> <FaLinkedin/> <FaInstagramSquare/> <FaFacebookF/>
	</div>
	<div className="col-md-3">
	<input type="email" id="email" className="form-control rounded-pill" placeholder="enter email address"/>
	</div>
	<div className="col-md-3 mx-5">
	<button type="button" className='btn btn-primary'>Subscribe</button>
	</div>
	</div>
	</div>
	</>
	);
}

export default Footer;
